import { useState } from "react";

function Sumar() {
  const [num, setNum] = useState(0);
  function sumar() {
    setNum(num + 1);
  }
  return (
    <>
      <p>{num}</p>
      <button onClick={sumar}>SUMAR</button>
    </>
  );
}

export default Sumar;
